Jairzinho era ponta direita (7), na seleção brasileira e não lateral esquerdo. No Botafogo era centro -avante (10)  o Botafogo   porém cedeu dois grandes laterais ao selecionado, foram eles ;
Nilton Santos (58/62)e marinho chagas  chagas (74). Existe uma mística dita no seio da família botafoguense que esse jejum de títulos  do Brasil ,deve-se a ausência de craques do fogão na seleção. Eu creio.
